function Product()
{
    const items = [
        {
            name : "Mac book",
            price : "1000",
        },
        {
            name : "Lenovo legion-5",
            price : "800",
        }

    ]
    return(
       <div className = "items">
           {
               items.map((item) => (<div>
                   <h3>{`Name : ${item.name}`}</h3>
                   <h5>{`Price : ${item.price}`}</h5>
               </div>))
           }
       </div>
    );
}

export default Product;
